import React from 'react'
import Navbar from '../layouts/Navbar'

export function CheckoutNoAcc() {
    return (
        <div>
            <Navbar></Navbar>

            <div>

                <div fixed='bottom' style={{ height: "250px" }} bgColor='light'>

                </div>
            </div>
        </div>
    )
}

export function CheckoutWithAcc() {
    return (
        <div>
            <Navbar></Navbar>
            <div></div>
        </div>
    )
}

function stickyFooter() {
    return (
        <div fixed='bottom' style={{ height: "250px" }} bgColor='light'>

        </div>
    )
}
